INSERT INTO `htmlformentry_html_form` (`id`,`form_id`,`name`,`xml_data`,`creator`,`date_created`,`changed_by`,`date_changed`,`retired`,`uuid`,`description`,`retired_by`,`date_retired`,`retire_reason`) VALUES 
 (1,1,NULL,'<htmlform> <!-- Autogenerated example form  (template from 01-Nov-2010 -->\r\n<translations defaultLocale=\"en\">\r\n    <code name=\"Referral Request Date\">\r\n        <variant locale=\"en\" value=\"Referral Request Date\"/>\r\n        <variant locale=\"fr\" value=\"Date de la demande du transfert\"/>\r\n    </code>\r\n    <code name=\"Refer Patient To\">\r\n        <variant locale=\"en\" value=\"Refer Patient To\"/>\r\n        <variant locale=\"fr\" value=\"Transfre le patient vers\"/>\r\n    </code>\r\n    <code name=\"Reason For Referral\">\r\n        <variant locale=\"en\" value=\"Reason For Referral\"/>\r\n        <variant locale=\"fr\" value=\"Raisons du transfert vers un autre site\"/>\r\n    </code>\r\n   <code name=\"Referral Urgency\">\r\n        <variant locale=\"en\" value=\"Referral Urgency\"/>\r\n        <variant locale=\"fr\" value=\"Urgence du Transfert\"/>\r\n    </code>\r\n<code name=\"Immediate Referral\">\r\n        <variant locale=\"en\" value=\"Immediate Referral\"/>\r\n        <variant locale=\"fr\" value=\"renvoi immdiat\"/>\r\n    </code>\r\n<code name=\"Urgent\">\r\n        <variant locale=\"en\" value=\"Urgent\"/>\r\n        <variant locale=\"fr\" value=\"Urgent\"/>\r\n    </code>\r\n<code name=\"Routine\">\r\n        <variant locale=\"en\" value=\"Routine\"/>\r\n        <variant locale=\"fr\" value=\"Routine\"/>\r\n    </code>\r\n\r\n</translations>\r\n<macros> \r\npaperFormId = (Fill this in) \r\nheaderColor =#009d8e\r\nfontOnHeaderColor = white \r\n</macros>\r\n\r\n<style>\r\n.section {\r\n	border: 1px solid$headerColor;\r\n	padding: 2px;\r\n	text-align: left;\r\n	margin-bottom: 1em;\r\n}\r\n\r\n.sectionHeader {\r\n	background-color: $headerColor;\r\n	color: $fontOnHeaderColor;\r\n	display: block;\r\n	padding: 2px;\r\n	font-weight: bold;\r\n}\r\n\r\ntable.baseline-aligned td {\r\n	vertical-align: center;\r\n}\r\n</style>\r\n\r\n<span style=\"float: right\">Paper Form ID: $paperFormId</span>\r\n<h2>RHEA Referral Form (v1.0)</h2>\r\n<includeIf velocityTest=\"$patient.gender == \'F\' \">\r\n<section headerLabel=\"1. Encounter Details\">\r\n	<table class=\"baseline-aligned\">\r\n		<tr>\r\n			<td>Date:</td>\r\n			<td><encounterDate default=\"today\" /></td>\r\n		</tr>\r\n		<tr>\r\n			<td>Location:</td>\r\n			<td><encounterLocation default=\"GlobalProperty:registration.defaultLocationCode\"/></td>\r\n		</tr>\r\n		<tr>\r\n			<td>Provider:</td>\r\n			<td><encounterProvider default=\"currentUser\"/></td>\r\n		</tr>\r\n	</table>\r\n</section>\r\n\r\n<section headerLabel=\"2. Referral Information\">\r\n	<table class=\"baseline-aligned\">\r\n\r\n\r\n		<tr>\r\n			\r\n			<td><obs conceptId=\"3\" labelCode=\"Referral Request Date\"/></td>\r\n		</tr>\r\n		<tr>\r\n			\r\n			<td><obs conceptId=\"4\" style=\"textarea\" rows=\"3\" cols=\"30\" labelCode=\"Refer Patient To\"/></td>\r\n		</tr>\r\n\r\n	</table>\r\n</section>\r\n\r\n<submit /> \r\n\r\n</includeIf>\r\n<includeIf velocityTest=\"$patient.gender == \'M\' \">\r\n<section headerLabel=\"Invalid Patient Message\">\r\n\r\n		<table border=\"0\" width=\"100%\">\r\n           \r\n        <tr><td>This Form Is Only Filled For Female Patients:</td>\r\n				\r\n        </tr>\r\n\r\n     </table>\r\n\r\n	</section>\r\n</includeIf> \r\n</htmlform>',1,'2013-11-05 13:17:20',1,'2013-11-05 13:44:15',0,'93dff753-53bd-4917-9d96-3edafd8464ed',NULL,NULL,NULL,NULL),
