</h2>\r\n<includeIf velocityTest=\"$patient.gender == \'F\' \">\r\n<section headerLabel=\"1. Encounter Details\">\r\n	<table class=\"baseline-aligned\">\r\n		<tr>\r\n			<td>Date:</td>\r\n			<td><encounterDate default=\"today\" /></td>\r\n		</tr>\r\n		<tr>\r\n			<td>Location:</td>\r\n			<td><encounterLocation default=\"GlobalProperty:registration.defaultLocationCode\"/></td>\r\n		</tr>\r\n		<tr>\r\n			<td>Provider:</td>\r\n			<td><encounterProvider default=\"currentUser\"/></td>\r\n		</tr>\r\n	</table>\r\n</section>\r\n\r\n<section headerLabel=\"2. Referral Information\">\r\n	<table class=\"baseline-aligned\">\r\n\r\n\r\n		<tr>\r\n			\r\n			<td><obs conceptId=\"5\" labelCode=\"Referral Request Date\"/></td>\r\n		</tr>\r\n		<tr>\r\n			\r\n			<td><obs conceptId=\"6\" style=\"textarea\" rows=\"3\" cols=\"30\" labelCode=\"Refer Patient To\"/></td>\r\n		</tr>\r\n		<tr>\r\n			\r\n			<td><obs conceptId=\"7\" style=\"textarea\" rows=\"3\" cols=\"30\" labelCode=\"Reason For Referral\"/></td>\r\n		</tr>\r\n		<tr>\r\n			\r\n			<td><obs conceptId=\"8\" labelCode=\"Referral Urgency\"  style=\"radio\"  answerCodes=\"Immediate Referral,Urgent,Routine\"/></td>\r\n		</tr>\r\n	</table>\r\n</section>\r\n\r\n<submit /> \r\n\r\n</includeIf>\r\n<includeIf velocityTest=\"$patient.gender == \'M\' \">\r\n<section headerLabel=\"Invalid Patient Message\">\r\n\r\n		<table border=\"0\" width=\"100%\">\r\n           \r\n        <tr><td>This Form Is Only Filled For Female Patients:</td>\r\n				\r\n        </tr>\r\n\r\n     </table>\r\n\r\n	</section>\r\n</includeIf> \r\n</htmlform>',1,'2013-11-12 13:34:43',1,'2013-11-12 13:52:45',0,'3081752f-9264-469c-bc35-c3c64a943b27',NULL,NULL,NULL,NULL);
